/****** Data: TABLE [dbo].[SEOC] ******/
PRINT '**** BEFORE update: existing records with incorrect date format for activatedTimestamp ****'
select count(*) from seoc
where activatedTimestamp = '6923-01-01 00:00:00.0000000'  -- 172 rows

PRINT '**** UPDATE the date for activatedTimestamp to correct it ****'
update seoc 
set activatedTimestamp = '12/14/2018 00:01:00.0000'
where activatedTimestamp = '6923-01-01 00:00:00.0000000' --172 updated

PRINT '**** AFTER update: existing records with incorrect date format for activatedTimestamp ****'
select count(*) from seoc
where activatedTimestamp = '6923-01-01 00:00:00.0000000'  -- 0 rows

PRINT '**** BEFORE update: existing records with incorrect date format for discontinuedTimestamp ****'
select count(*) from seoc
where discontinuedTimestamp = '6923-01-01 00:00:00.0000000'  -- 48 rows

PRINT '**** UPDATE the date for discontinuedTimestamp to correct it ****'
update seoc 
set discontinuedTimestamp = '12/14/2018 00:01:00.0000'
where discontinuedTimestamp = '6923-01-01 00:00:00.0000000' --172 updated

PRINT '**** AFTER update: existing records with incorrect date format for discontinuedTimestamp ****'
select count(*) from seoc
where discontinuedTimestamp = '6923-01-01 00:00:00.0000000'  -- 0 rows

PRINT '**** reset to NULL for incorrect default date ****'
update seoc 
set discontinuedTimestamp = NULL
where discontinuedTimestamp = '1900-01-01 00:00:00.0000000' --2 updated


